import React, { useState } from 'react';
import axios from 'axios';

const AddProduct = () => {
  const [product, setProduct] = useState({
    name: '',
    description: '',
    price: '',
    category: '',
    image: null,
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setProduct({ ...product, [name]: value });
  };

  const handleImageChange = (e) => {
    setProduct({ ...product, image: e.target.files[0] });
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    const formData = new FormData();
    formData.append('name', product.name);
    formData.append('description', product.description);
    formData.append('price', product.price);
    formData.append('category', product.category);
    formData.append('image', product.image);

    axios
      .post('http://127.0.0.1:8000/api/products/add/', formData, {
        headers: {
          'Content-Type': 'multipart/form-data',
        },
      })
      .then((response) => {
        console.log('Produit ajouté:', response.data);
        alert('Produit ajouté avec succès!');
      })
      .catch((error) => {
        console.error('Erreur lors de l\'ajout du produit:', error);
        alert('Erreur lors de l\'ajout du produit');
      });
  };

  return (
    <div style={{ padding: '20px', backgroundColor: '#0a0a0a' }}>
      <h2 style={{ color: '#39ff14' }}>Ajouter un Produit</h2>
      <form onSubmit={handleSubmit} style={{ color: '#fff' }}>
        <div style={{ marginBottom: '10px' }}>
          <input
            type="text"
            name="name"
            placeholder="Nom du produit"
            value={product.name}
            onChange={handleChange}
            required
            style={{ padding: '10px', width: '100%', borderRadius: '5px' }}
          />
        </div>
        <div style={{ marginBottom: '10px' }}>
          <input
            type="text"
            name="description"
            placeholder="Description"
            value={product.description}
            onChange={handleChange}
            required
            style={{ padding: '10px', width: '100%', borderRadius: '5px' }}
          />
        </div>
        <div style={{ marginBottom: '10px' }}>
          <input
            type="number"
            name="price"
            placeholder="Prix"
            value={product.price}
            onChange={handleChange}
            required
            style={{ padding: '10px', width: '100%', borderRadius: '5px' }}
          />
        </div>
        <div style={{ marginBottom: '10px' }}>
          <select
            name="category"
            value={product.category}
            onChange={handleChange}
            required
            style={{ padding: '10px', width: '100%', borderRadius: '5px' }}
          >
            <option value="">Sélectionner une catégorie</option>
            <option value="Electronics">Électronique</option>
            <option value="Laptops">Laptops</option>
            <option value="Arts">Arts</option>
            <option value="Food">Alimentation</option>
            <option value="Home">Maison</option>
            <option value="Kitchen">Cuisine</option>
          </select>
        </div>
        <div style={{ marginBottom: '10px' }}>
          <input
            type="file"
            name="image"
            onChange={handleImageChange}
            required
            style={{ padding: '10px', width: '100%' }}
          />
        </div>
        <button
          type="submit"
          style={{
            backgroundColor: '#39ff14',
            color: 'black',
            padding: '10px 20px',
            fontSize: '16px',
            border: 'none',
            borderRadius: '5px',
            cursor: 'pointer',
          }}
        >
          Ajouter le produit
        </button>
      </form>
    </div>
  );
};

export default AddProduct;
